import React from 'react';

class Login extends React.Component {

    constructor(props){
        super(props);
        this.state = {}
    }

    modal = () => (
        <div id="modal_2" className="modal">
            <div className="modal-dialog modal-lg" role="document">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">Регистрация нового пассажира</h5>
                        <button type="button" className="close" onClick="cancelBuyTicket()">
                            <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body" />
                    <div className="modal-footer">
                        <button type="button" className="btn btn-primary" onClick="cancelBuyTicket()">ОК</button>
                    </div>
                </div>
            </div>
        </div>
    );

    render() {
        return this.modal();
    }
}

export default Login;
